import React, { Component } from 'react';
import styled from 'styled-components';

const Wrapper = styled.div`
  height: 100vh;
  width: 100vw;

`;

class LandingSection extends Component {
  render(){
    return(
      <Wrapper>
        Landing Section
      </Wrapper>
    );
  }
}

export { LandingSection };
